class Bot:
	"""docstring for Bot"""
	def __init__(self):
		super(Bot, self).__init__()

		# the delay for loading of page
		self.headers = {'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/71.0.3578.98 Safari/537.36'}

		# setup the browser
		self.browser = self.setupBrowser()

		# driver = self.browser
		# download_dir = 'C:\\Users\\christian\\Documents\\work\\python\\eyewitness'

		# # add missing support for chrome "send_command"  to selenium webdriver
		# driver.command_executor._commands["send_command"] = ("POST", '/session/$sessionId/chromium/send_command')

		# params = {'cmd': 'Page.setDownloadBehavior', 'params': {'behavior': 'allow', 'downloadPath': download_dir}}
		# command_result = driver.execute("send_command", params)

	def loadPage(self, url):
		self.browser.get(url)

	def download(self, url):
		self.loadPage(url)

		time.sleep(1)
		q = self.browser.find_element_by_tag_name('body')

		for i in range(10):
			q.send_keys(Keys.CONTROL + 't')

		time.sleep(10)

	def setupBrowser(self):
		options = webdriver.ChromeOptions()
		options.add_argument('--ignore-certificate-errors')
		
		# options.add_argument("--test-type")
		options.add_argument("--start-maximized")

		# options.add_argument("--headless")
		driver_path = r"drivers/chromedriver.exe"

		download_dir = 'C:\\Users\\christian\\Documents\\work\\python\\eyewitness'

		options.add_experimental_option('prefs',  {
		    "download.default_directory": download_dir,
		    "download.prompt_for_download": False,
		    "download.directory_upgrade": True,
		    "plugins.plugins_disabled": ["Chrome PDF Viewer"]
		    }
		)

		return webdriver.Chrome(chrome_options=options, executable_path=driver_path)
		

def download(url):
	# all is well, initializwe the browser
	BOT = Bot()
	BOT.download(url)
	BOT.browser.quit()


